import "./App.css";
import "./index.css";
import Header from "./containers/header/Header.js";

import {
  AboutUs,
  HowItWorks,
  Navbar,
  Pricing,
  WelcomeBlock,
} from "./components";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Header />
      <AboutUs />
      <HowItWorks />
    </div>
  );
}

export default App;
